ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#000000\\\">.في تلكَ الرّحلةِ والتّفاصيلِ الّتي حدثتْ معَهُ</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#0086ff\\\">الخاتمةُ:</span><span style=\\\"color:#000000\\\"> وهنا يذكرُ التّلميذُ وقتَ العودةِ واصفًا مشاعرَهُ متحدّثًا عنْ رأيِهِ </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#000000\\\">.في تلكَ الرّحلةِ</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"3009fad3-36a8-4940-ac94-822263953d04\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1410314924691922,\"y\":83.7770678026269,\"width\":7.990867579908676,\"height\":14.202820903094874,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"الصورة\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAdIAAAHSCAYAAAEvZ3qgAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFxEAABcRAcom8z8AAH90SURBVHhe7Z0HmCxF1feb14QoiAJGQKIKKooEs/iZXrMCkkRQQFBRVETEPN6dru7ZG7hcJIgJA4iCiAKiV0CQZEIk+ErOOYebd6dOf+dUV++dma2e6Z7YM/P/Pc9/Z6enqjpV1alcXt9YRE/zQvqQF+iLvCCK4k/az1tAT7cuhpRFtIE3V26oDVXkc/rdNqSCUoqePPviibwTozWti9YoemJWGJPLXmh/LQA+vafu4nza1/7SGRO0VV24ihbbXwZEciEhq5fMs+cRTdC29mifMOnKqp8k5+zbeZOT+dGr7ZH+k1xDKVrLHukyiraeOUkRSK5F6SvtkS7h0ykmYDEnRWKS7jTXJcmqK/j6l/FTpJX2SLEI6ZPdeRFJ1J2kJfZIManQnvaF3GyPtEFXnlifUPo6c71h9Gx7JAfmSQ3JjSaIvc99zYkdHUZyvyRxPEg72inmhunL9lsTcj+ZApLpHiam3zv0N5og96HoIfvNgThot1C/oGAPKaBH01/cQdFT2n6rAdvhIsYIuaaASvZbDeaHNi64tvpVNF
